    <script>
        let paths = document.querySelectorAll('path');
        let section2 = document.getElementById('section2'); // assuming you have a section with id "section2"

        for (let i = 0; i < paths.length; i++) {
            let path = paths[i];
            let pathLength = path.getTotalLength();

            path.style.strokeDasharray = pathLength + ' ' + pathLength;

            // start with hidden
            path.style.strokeDashoffset = pathLength;

            // fire scroll
            window.addEventListener('scroll', () => {
                let section2OffsetTop = section2.offsetTop;
                let windowHeight = window.innerHeight;
                let scrollPosition = document.documentElement.scrollTop + document.body.scrollTop;
                let maxScroll = section2OffsetTop - windowHeight;

                // stop animation at section 2
                if (scrollPosition > maxScroll) {
                    path.style.strokeDashoffset = 0;
                } else {
                    let scrollPercentage = scrollPosition / maxScroll;
                    let drawLength = pathLength * scrollPercentage;
                    path.style.strokeDashoffset = pathLength - drawLength;
                }
            });
        }
    </script>
